import React from "react";
import { useHistory, Link } from "react-router-dom";
function Home() {
  let history = useHistory();

  function handleClick() {
    history.push("/all-recipes");
  }
  return (
    <div>
      <p>MISSION STATEMENT</p>
      <span>
        <Link className="button" to="all-recipes">
          All Recipes
        </Link>
      </span>
    </div>
  );
}
export default Home;
